import 'package:flutter/cupertino.dart';
import 'package:flutter/material.dart';
import '../Database/CardDetails.dart';

class AddNewCard extends StatefulWidget {
  const AddNewCard({super.key});

  @override
  State<AddNewCard> createState() => _AddNewCardState();
}

class _AddNewCardState extends State<AddNewCard> {
  final namecontroller = TextEditingController();
  final emailcontroller = TextEditingController();
  final numbercontroller = TextEditingController();
  final placecontroller = TextEditingController();
  final zipcontroller = TextEditingController();
  final expirycontroller = TextEditingController();
  final cvvcontroller = TextEditingController();
  bool _isLoading = false;

  Future<void> SendCard() async {
    if (_validateFields()) {
      setState(() {
        _isLoading = true;
      });

      try {
        await CardDetails().CardDetailsToFirestore(
          Fullname: namecontroller.text,
          email: emailcontroller.text,
          cardnumber: numbercontroller.text,
          expiry: expirycontroller.text,
          cvv: cvvcontroller.text,
          country: placecontroller.text,
          zip: zipcontroller.text,
          image: '',
        );

        _clearForm();

        // Show success message
        ScaffoldMessenger.of(context).showSnackBar(
          const SnackBar(content: Text('Card added successfully')),
        );

        Future.delayed(const Duration(milliseconds: 1500), () {
          Navigator.pop(context);
        });
      } catch (e) {
        ScaffoldMessenger.of(context).showSnackBar(
          SnackBar(content: Text('Error: $e')),
        );
      } finally {
        setState(() {
          _isLoading = false;
        });
      }
    }
  }

  bool _validateFields() {
    if (namecontroller.text.isEmpty ||
        emailcontroller.text.isEmpty ||
        numbercontroller.text.isEmpty ||
        expirycontroller.text.isEmpty ||
        cvvcontroller.text.isEmpty ||
        placecontroller.text.isEmpty ||
        zipcontroller.text.isEmpty) {
      ScaffoldMessenger.of(context).showSnackBar(
        const SnackBar(content: Text('Please fill all fields')),
      );
      return false;
    }

    // Add additional validation as needed
    if (numbercontroller.text.length < 12) {
      ScaffoldMessenger.of(context).showSnackBar(
        const SnackBar(content: Text('Please enter a valid card number')),
      );
      return false;
    }

    return true;
  }

  void _clearForm() {
    namecontroller.clear();
    emailcontroller.clear();
    numbercontroller.clear();
    expirycontroller.clear();
    cvvcontroller.clear();
    placecontroller.clear();
    zipcontroller.clear();
  }

  @override
  void dispose() {
    namecontroller.dispose();
    emailcontroller.dispose();
    numbercontroller.dispose();
    placecontroller.dispose();
    zipcontroller.dispose();
    expirycontroller.dispose();
    cvvcontroller.dispose();
    super.dispose();
  }

  @override
  Widget build(BuildContext context) {
    final mediaQueryData = MediaQuery.of(context);
    final screenHeight = mediaQueryData.size.height;
    final screenWidth = mediaQueryData.size.width;

    return Scaffold(
      backgroundColor: Colors.grey.shade300,
      body: SafeArea(
        child: Column(
          children: [
            Container(
              height: screenHeight * 0.058,
              width: double.infinity,
              color: Colors.white60,
              child: Row(
                children: [
                  Padding(
                    padding: const EdgeInsets.only(left: 15.0),
                    child: GestureDetector(
                      onTap: () => Navigator.pop(context),
                      child: const Icon(
                        Icons.arrow_back,
                        size: 23,
                        color: Colors.black,
                      ),
                    ),
                  ),
                  SizedBox(width: screenWidth * 0.053),
                  const Text(
                    "Add New Card",
                    style: TextStyle(fontSize: 19, fontWeight: FontWeight.w500),
                  )
                ],
              ),
            ),

            Expanded(
              child: SingleChildScrollView(
                child: Column(
                  children: [
                    SizedBox(
                      height: screenHeight * 0.205,
                      width: screenWidth * 0.850,
                      child: Image.asset(
                        "assets/images/ForgotPassword/debitcard2.png",
                        height: screenHeight * 0.190,
                        width: screenWidth * 0.850,
                        fit: BoxFit.cover,
                      ),
                    ),

                    const Row(
                      children: [
                        Padding(
                          padding: EdgeInsets.symmetric(horizontal: 15.0),
                          child: Text(
                            "Card Information",
                            style: TextStyle(
                              fontWeight: FontWeight.w500,
                              fontSize: 16,
                              color: Colors.black,
                            ),
                          ),
                        ),
                      ],
                    ),

                    Form(
                      child: Column(
                        children: [
                          // Name field
                          _buildTextField(
                            context: context,
                            controller: namecontroller,
                            label: "Full name",
                            hint: "John Doe",
                            icon: Icons.perm_identity,
                            keyboardType: TextInputType.text,
                          ),

                          // Email field
                          _buildTextField(
                            context: context,
                            controller: emailcontroller,
                            label: "Email",
                            hint: "johndoe123@gmail.com",
                            icon: Icons.email_outlined,
                            keyboardType: TextInputType.emailAddress,
                          ),

                          // Card number field
                          _buildTextField(
                            context: context,
                            controller: numbercontroller,
                            label: "Card number",
                            hint: "0000 0000 0000 0000",
                            suffixIcon: CupertinoIcons.creditcard,
                            keyboardType: TextInputType.number,
                          ),

                          // Expiry and CVV row
                          Padding(
                            padding: const EdgeInsets.symmetric(
                              horizontal: 15.0,
                              vertical: 6.0,
                            ),
                            child: SizedBox(
                              height: screenHeight * 0.055,
                              width: screenWidth * 0.90,
                              child: Row(
                                mainAxisAlignment: MainAxisAlignment.spaceBetween,
                                children: [
                                  // Expiry field
                                  SizedBox(
                                    height: screenHeight * 0.055,
                                    width: screenWidth * 0.440,
                                    child: TextFormField(
                                      controller: expirycontroller,
                                      keyboardType: TextInputType.number,
                                      decoration: InputDecoration(
                                        filled: true,
                                        fillColor: Colors.white30,
                                        enabledBorder: OutlineInputBorder(
                                          borderRadius: BorderRadius.circular(10),
                                          borderSide: const BorderSide(
                                            color: Colors.grey,
                                            width: 1.0,
                                          ),
                                        ),
                                        focusedBorder: OutlineInputBorder(
                                          borderRadius: BorderRadius.circular(10),
                                          borderSide: const BorderSide(
                                            color: Colors.black,
                                            width: 1.0,
                                          ),
                                        ),
                                        hintText: "MM/YY",
                                        hintStyle: const TextStyle(
                                          fontSize: 15,
                                          fontWeight: FontWeight.w500,
                                          color: Colors.grey,
                                        ),
                                      ),
                                    ),
                                  ),

                                  // CVV field
                                  SizedBox(
                                    height: screenHeight * 0.055,
                                    width: screenWidth * 0.440,
                                    child: TextFormField(
                                      controller: cvvcontroller,
                                      keyboardType: TextInputType.number,
                                      obscureText: true,
                                      decoration: InputDecoration(
                                        filled: true,
                                        fillColor: Colors.white30,
                                        enabledBorder: OutlineInputBorder(
                                          borderRadius: BorderRadius.circular(10),
                                          borderSide: const BorderSide(
                                            color: Colors.grey,
                                            width: 1.0,
                                          ),
                                        ),
                                        focusedBorder: OutlineInputBorder(
                                          borderRadius: BorderRadius.circular(10),
                                          borderSide: const BorderSide(
                                            color: Colors.black,
                                            width: 1.0,
                                          ),
                                        ),
                                        hintText: "CVV",
                                        hintStyle: const TextStyle(
                                          fontSize: 15,
                                          fontWeight: FontWeight.w500,
                                          color: Colors.grey,
                                        ),
                                        suffixIcon: const Icon(
                                          Icons.credit_score_outlined,
                                          color: Colors.grey,
                                        ),
                                      ),
                                    ),
                                  ),
                                ],
                              ),
                            ),
                          ),

                          const Row(
                            children: [
                              Padding(
                                padding: EdgeInsets.symmetric(
                                  horizontal: 15.0,
                                  vertical: 10.0,
                                ),
                                child: Text(
                                  "Country or Region",
                                  style: TextStyle(
                                    fontWeight: FontWeight.w500,
                                    fontSize: 16,
                                    color: Colors.black,
                                  ),
                                ),
                              ),
                            ],
                          ),

                          // Country field
                          _buildTextField(
                            context: context,
                            controller: placecontroller,
                            label: "Country/region",
                            hint: "India",
                            icon: Icons.location_on_outlined,
                            keyboardType: TextInputType.text,
                          ),

                          // ZIP field
                          _buildTextField(
                            context: context,
                            controller: zipcontroller,
                            label: "Zip",
                            hint: "000000",
                            icon: Icons.map_outlined,
                            keyboardType: TextInputType.number,
                          ),

                          SizedBox(height: screenHeight * 0.05),

                          // Add button
                          Padding(
                            padding: const EdgeInsets.symmetric(vertical: 8.0),
                            child: _isLoading
                                ? const CircularProgressIndicator()
                                : GestureDetector(
                              onTap: SendCard,
                              child: Container(
                                height: screenHeight * 0.055,
                                width: screenWidth * 0.88,
                                decoration: BoxDecoration(
                                  borderRadius: BorderRadius.circular(25),
                                  color: Colors.black,
                                ),
                                child: const Row(
                                  mainAxisAlignment: MainAxisAlignment.center,
                                  children: [
                                    Text(
                                      "Add",
                                      style: TextStyle(
                                        color: Colors.white,
                                        fontWeight: FontWeight.w500,
                                        fontSize: 16,
                                      ),
                                    ),
                                  ],
                                ),
                              ),
                            ),
                          ),
                        ],
                      ),
                    ),
                  ],
                ),
              ),
            ),
          ],
        ),
      ),
    );
  }

  Widget _buildTextField({
    required BuildContext context,
    required TextEditingController controller,
    required String label,
    required String hint,
    IconData? icon,
    IconData? suffixIcon,
    required TextInputType keyboardType,
  }) {
    return Padding(
      padding: const EdgeInsets.symmetric(horizontal: 10.0, vertical: 6.0),
      child: SizedBox(
        height: MediaQuery.of(context).size.height * 0.055,
        width: MediaQuery.of(context).size.width * 0.90,
        child: TextFormField(
          controller: controller,
          keyboardType: keyboardType,
          decoration: InputDecoration(
            filled: true,
            fillColor: Colors.white30,
            enabledBorder: OutlineInputBorder(
              borderRadius: BorderRadius.circular(10),
              borderSide: const BorderSide(
                color: Colors.grey,
                width: 1.0,
              ),
            ),
            focusedBorder: OutlineInputBorder(
              borderRadius: BorderRadius.circular(12),
              borderSide: const BorderSide(
                color: Colors.black,
                width: 1.0,
              ),
            ),
            labelText: label,
            labelStyle: const TextStyle(
              fontSize: 15,
              fontWeight: FontWeight.w500,
              color: Colors.black54,
            ),
            hintText: hint,
            hintStyle: const TextStyle(
              fontWeight: FontWeight.w500,
              fontSize: 15,
              color: Colors.grey,
            ),
            prefixIcon: icon != null ? Icon(icon, color: Colors.grey) : null,
            suffixIcon: suffixIcon != null
                ? Icon(suffixIcon, color: Colors.grey)
                : null,
          ),
        ),
      ),
    );
  }
}